import { useState } from "react";
import React from "react";
import Child from "./Child";

const Father = () => {
  const [fruitList, setFruitList] = useState([]);
  const fruit = ["apple", "pear", "banana"];

  useState(() => {
    setFruitList(fruit);
  }, []);
  const handleBtn = () => {
    <Child name="Gal" fruitList={fruitList} />;
  };

  return (
    <div>
      <h1>Hello im The Father</h1>
      <button onClick={handleBtn}>Show List</button>
    </div>
  );
};

export default Father;
